import "./AboutMe.css";

function AboutMe() {

    return (
    <div className ="aboutme">
        <div className="aboutme__container">
        <p className="aboutme__text">Студент</p>
        <div className="aboutme__container-line" />
        <div className="aboutme__container_description-and-photo">
            <div className="aboutme__container_description"></div>
            <img className="aboutme__container_description" />
        </div>
        </div>
    </div>
        );
    }
    
    export default AboutMe;
